import React from "react";
import "./Goals.css";
import GoalItem from "../GoalItem/GoalItem";

const Goals = (props) => {
    console.log(props);

    return (
        <section id="goals">
        <ul className="goal-list">
          <GoalItem value={props.goals.value}/>
        </ul>
      </section>
    )
}

export default Goals;
